/**
 * @template T
 * @param {number} [skip]
 * @param {string} [comment]
 * @param {(value: T) => string} [accessor]
 * @returns {TransformStream<T[]> | null}
 */
export function lineFilter<T>(skip?: number, comment?: string, accessor?: (value: T) => string): TransformStream<T[]> | null;
/**
 * Returns a new line filter stream transformer.
 * @template T
 * @param {number} [skip]
 * @param {string} [comment]
 * @param {(value: T) => string} [accessor]
 * @returns {Transformer<T[], T[]>}
 */
export function lineFilterTransformer<T>(skip?: number, comment?: string, accessor?: (value: T) => string): Transformer<T[], T[]>;
